        <Route exact path="/" component={Index} />
        {/* <Route path="/about" component={Candidature} /> */}
        {/* <Route path="/contact" component={ContactPage} /> */}
        {/* Add more routes for other pages */}
      </Switch>
    </div>
  </Router>


  );
}

export default App;
